<?php

/*
 * Theme Default Options for Activation Process
 */

function ut_theme_default_setting( $demo = 'default' ) {
    
    $ut_theme_default_setting = apply_filters( 'ut_theme_default_setting', array(
        'default' => '',
    ) );
    
    return isset( $ut_theme_default_setting[$demo] ) ? $ut_theme_default_setting[$demo] : false; 
    
}